export const Form = () => {
  const navigate = useNavigate();
  const parameters: string | undefined = useParams().user;

  return (
    <section>
      <p onClick={() => navigate("/")}>Wanna go home?</p>
      <p>{`${parameters?.slice(0, 1).toUpperCase()}`} Sign Up </p>
      <p></p>
      <input></input>
      <input></input>
      <input></input>
    </section>
  );
};
